  ammonia, and silicate. Data were submitted by the Marine Environmental Data Service
  (MEDS) of Canada and are in the MEDS ASCII format.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
